import React from 'react';
import '../styles/navbar.css';
import Logo from "../components/Logo.js"

function Navbar() {

    return ( 
        <div class="container">
            <span class = "logoLetter">IGN</span>
            <span class = "navOptions">News</span>
            <span class = "navOptions">Videos</span>
            <span class = "navOptions">Reviews</span>
            <span class = "navOptions">Shows</span>
            <span class = "navOptions">Wikis</span>
        </div>
     );
}

export default Navbar;
